    password: null,
    refresh_token: null,
    spotify_profile: null,
    image: null,
    token: null
}
const defaultGenreSongs = {
    genre: null,
    tracks: [],
}
const defaultRecommend = {
    songs: []
}

const recommendReducer = (state=defaultRecommend, action) => {
    switch (action.type) {
        case "create":
            return action.songs
        default:
            return state    
    }
}
const changeRecommends = (song) => {
    return({
