        case "create":
            return action.profile
        default:
            return state
    }
}
const newProfileAction = profile => {
    return({
        type: "create",
        profile
    })
}
const exploreReducer = (state=defaultGenreSongs, action) => {
    switch(action.type){
        case "changeGenre":
            return action.genre
        default:
            return state
    }
}
const changeGenre = genre => {
